        {
            ElectricImpedance ohm = ElectricImpedance.FromOhms(1);
            Assert.Equal(0, ohm.CompareTo(ohm));
            Assert.True(ohm.CompareTo(ElectricImpedance.Zero) > 0);
            Assert.True(ElectricImpedance.Zero.CompareTo(ohm) < 0);
        }

